DROP TABLE IF EXISTS "t_stat_sets";
CREATE TABLE "t_stat_sets" (
  "set_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT,
  "set_name" text NOT NULL,
  "set_note" text NULL,
  "set_deleted" integer NOT NULL DEFAULT '0',
  "update_by" integer NULL,
  "update_on" integer NULL
);


DROP TABLE IF EXISTS "t_stat_tags";
CREATE TABLE "t_stat_tags" (
  "tag_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT,
  "set_id" integer NOT NULL,
  "tag_order" integer NULL,
  "tag_id_next" integer NULL,
  "tag_color" text NULL,
  "tag_what" text NULL,
  "tag_how" text NULL,
  "tag_result" text NULL,
  "tag_tip" text NULL,
  "tag_points" real NOT NULL DEFAULT '0',
  "tag_note" text NULL,
  "possession" integer NOT NULL DEFAULT '0',
  "ggroup" text NULL,
  "update_by" integer NULL,
  "update_on" integer NULL DEFAULT ''
);

CREATE UNIQUE INDEX "t_stt_tags_set_id_tag_what_tag_how_tag_result" ON "t_stat_tags" ("set_id", "tag_what", "tag_how", "tag_result");






